import React from 'react';
import './App.css';

const sections = [
  { id: 'goals', title: 'Goals and Objectives' },
  { id: 'meetings', title: 'Meeting Schedule' },
  { id: 'tasks', title: 'Task and Action Items' },
  { id: 'progress', title: 'Progress Tracking' },
  { id: 'resources', title: 'Resources and Materials' },
  { id: 'feedback', title: 'Feedback and Reflection' },
  { id: 'communication', title: 'Communication Log' },
  { id: 'development', title: 'Personal Development' },
  { id: 'notes', title: 'Notes and Ideas' },
  { id: 'contact', title: 'Contact Information' },
];

const App = () => {
  return (
    <div className="container">
      <Sidebar sections={sections} />
      <Content sections={sections} />
    </div>
  );
};

const Sidebar = ({ sections }) => {
  return (
    <div className="sidebar">
      <div className="header">Sections</div>
      {sections.map((section) => (
        <a key={section.id} href={`#${section.id}`}>
          {section.title}
        </a>
      ))}
    </div>
  );
};

const Content = ({ sections }) => {
  return (
    <div className="content">
      <div className="header">Mentee-Mentor Dashboard</div>
      {sections.map((section) => (
        <Section key={section.id} id={section.id} title={section.title} />
      ))}
    </div>
  );
};

const Section = ({ id, title }) => {
  return (
    <div className="section" id={id}>
      <div className="section-title">{title}</div>
      <ul className="item-list">
        {/* Add your section-specific content here */}
        <li className="item">Example item for {title}</li>
      </ul>
    </div>
  );
};

export default App;
